import React, { useState } from "react";

const CropPrediction = () => {
    const [formData, setFormData] = useState({
        N: "",
        P: "",
        K: "",
        temperature: "",
        humidity: "",
        ph: "",
        rainfall: "",
    });

    const [recommendedCrop, setRecommendedCrop] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setRecommendedCrop(null);
        setError(null);
        setLoading(true);

        try {
            const response = await fetch("http://localhost:5000/api/auth/predict", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({
                    N: parseFloat(formData.N),
                    P: parseFloat(formData.P),
                    K: parseFloat(formData.K),
                    temperature: parseFloat(formData.temperature),
                    humidity: parseFloat(formData.humidity),
                    ph: parseFloat(formData.ph),
                    rainfall: parseFloat(formData.rainfall),
                }),
            });

            const data = await response.json();
            setLoading(false);

            if (response.ok) {
                setRecommendedCrop(data.recommended_crop);
            } else {
                setError(data.message || "Error predicting crop");
            }
        } catch (err) {
            setLoading(false);
            setError("Failed to connect to the backend");
        }
    };

    return (
        <div style={styles.pageContainer}>
            <div style={styles.container}>
                <h1 style={styles.header}>üå± Crop Prediction</h1>

                <form style={styles.form} onSubmit={handleSubmit}>
                    {Object.keys(formData).map((key) => (
                        <div key={key} style={styles.inputGroup}>
                            <label style={styles.label} htmlFor={key}>
                                {key.charAt(0).toUpperCase() + key.slice(1)}:
                            </label>
                            <input
                                type="number"
                                id={key}
                                name={key}
                                value={formData[key]}
                                onChange={handleChange}
                                style={styles.input}
                                required
                            />
                        </div>
                    ))}
                    <button type="submit" style={styles.submitButton} disabled={loading}>
                        {loading ? "Predicting..." : "Predict Crop"}
                    </button>
                </form>

                {recommendedCrop && (
                    <div style={styles.resultContainer}>
                        <h2 style={styles.result}>üåæ Recommended Crop:</h2>
                        <p style={styles.cropName}>{recommendedCrop}</p>
                    </div>
                )}
                {error && (
                    <div style={styles.errorContainer}>
                        <h2 style={styles.error}>‚ö†Ô∏è {error}</h2>
                    </div>
                )}
            </div>
        </div>
    );
};

const styles = {
    pageContainer: {
        height: "100vh",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#f4f4f4",
    },
    container: {
        background: "#fff",
        padding: "30px",
        borderRadius: "10px",
        boxShadow: "0px 10px 20px rgba(0, 0, 0, 0.1)",
        width: "450px",
        textAlign: "center",
    },
    header: {
        fontSize: "22px",
        fontWeight: "bold",
        color: "#333",
        marginBottom: "15px",
    },
    form: {
        display: "flex",
        flexDirection: "column",
        gap: "10px",
    },
    inputGroup: {
        textAlign: "left",
    },
    label: {
        display: "block",
        fontWeight: "600",
        color: "#555",
        marginBottom: "5px",
    },
    input: {
        width: "100%",
        padding: "10px",
        borderRadius: "6px",
        border: "1px solid #ccc",
        fontSize: "16px",
        outline: "none",
        transition: "border-color 0.3s",
        boxSizing: "border-box",
    },
    submitButton: {
        width: "100%",
        padding: "12px",
        fontSize: "16px",
        fontWeight: "bold",
        color: "#fff",
        backgroundColor: "#28a745",
        border: "none",
        borderRadius: "6px",
        cursor: "pointer",
        transition: "background 0.3s",
    },
    resultContainer: {
        marginTop: "20px",
        padding: "15px",
        backgroundColor: "#eaffea",
        borderRadius: "8px",
        textAlign: "center",
    },
    result: {
        color: "#218838",
        fontWeight: "bold",
    },
    cropName: {
        fontSize: "20px",
        fontWeight: "bold",
        color: "#155724",
    },
    errorContainer: {
        marginTop: "20px",
        padding: "15px",
        backgroundColor: "#ffe0e0",
        borderRadius: "8px",
        textAlign: "center",
    },
    error: {
        color: "#b00020",
        fontWeight: "bold",
    },
};

export default CropPrediction;
